// import "./App.css";
import React, { useEffect, useState } from "react";

function App() {
    const [dataBackend, setDataBackend] = useState({});

    useEffect(() => {
        fetch("/api")
            .then((res) => res.json())
            .then((data) => setDataBackend(data));
    }, []);

    console.log(dataBackend);

    return (
        <div className="App">
            {dataBackend.map((person, index) => {
                <p key={index}> person.name </p>;
            })}
        </div>
    );
}

export default App;
